<body>

    <script>

        var set = new Set();
        var objects = [
            eval,
            isFinite,
            isNaN,
            parseFloat,
            parseInt,
            decodeURI,
            decodeURIComponent,
            encodeURI,
            encodeURIComponent,
            Array,
            Date,
            RegExp,
            Promise,
            Proxy,
            Map,
            WeakMap,
            Set,
            WeakSet,
            Function,
            Boolean,
            String,
            Number,
            Symbol,
            Object,
            Error,
            EvalError,
            RangeError,
            ReferenceError,
            SyntaxError,
            TypeError,
            URIError,
            ArrayBuffer,
            SharedArrayBuffer,
            DataView,
            Float32Array,
            Float64Array,
            Int8Array,
            Int16Array,
            Int32Array,
            Uint8Array,
            Uint16Array,
            Uint32Array,
            Uint8ClampedArray,
            Atomics,
            JSON,
            Math,
            Reflect];

        objects.forEach(o => set.add(o));

        for (let o of objects) {
            let propertyNames = Object.getOwnPropertyNames(o);

            for (let p of propertyNames) {
                let d = Object.getOwnPropertyDescriptor(o, p);
                if ((d.value !== null && typeof d.value === "object") || (typeof d.value === "function"))
                {
                    if (!set.has(d.value)) set.add(d.value), objects.push(d.value); 
                }
                if (d.get) if (!set.has(d.get)) set.add(d.get), objects.push(d.get); 
                if (d.set) if (!set.has(d.set)) set.add(d.set), objects.push(d.set);
            }
        }


    </script>
</body>
